import React from "react";
import Playercards from "./Playercards";
import Agents from "./Agents";
import Maps from "./Maps";
import Weapons from "./Weapons";
function Navbar(){

    return <div id="navBar">
        <Playercards/>
        <ul>
            <li onClick={changeContent("Agents")}>Agents</li>
            <li onClick={changeContent("Cards")}>Cards</li>
            <li onClick={changeContent("Home")}>Home</li>
            <li onClick={changeContent("Weapons")}>Weapons</li>
            <li onClick={changeContent("Maps")}>Maps</li>
        </ul>
        </div>

}

function changeContent(a) {

    //alert()

}

export default Navbar
